import React from 'react';
import { StyledInstagramFeedContainer } from './InfoSectionElements';
import axios from 'axios';

const options = {
  method: 'GET',
  url: 'https://instagram85.p.rapidapi.com/account/47777329524/feed',
  headers: {
    'x-rapidapi-host': 'instagram85.p.rapidapi.com',
    'x-rapidapi-key': '100fe98584msh3cc3759f9aead09p18070ajsnfd70377b7ae1'
  }
};

axios.request(options).then(function (response) {
	console.log(response.data);
}).catch(function (error) {
	console.error(error);
});

const InstagramFeed = () => {
    return (
        <StyledInstagramFeedContainer>

        </StyledInstagramFeedContainer>
    )
}

export default InstagramFeed
